import{_ as e,c as n,a as r,o as i}from"./app-hPYerA9u.js";const d={};function c(p,a){return i(),n("div",null,a[0]||(a[0]=[r('<blockquote><p>All in AI，看见未来。 每天精选最值得读的AI文章，帮你筛掉时代的噪音。 以简讯见广度，以深读见洞察。 技术、趋势、思考，一站式掌握AI世界。 欢迎关注公众号「AI Reading Hub」，获取更多AI资讯和技术文章。</p></blockquote><h1 id="_2026-02-06-资讯日报" tabindex="-1"><a class="header-anchor" href="#_2026-02-06-资讯日报"><span>2026-02-06 资讯日报</span></a></h1><h2 id="新闻资讯" tabindex="-1"><a class="header-anchor" href="#新闻资讯"><span>新闻资讯</span></a></h2><h3 id="iclr-2026-workshop-二轮征稿聚焦终身智能体" tabindex="-1"><a class="header-anchor" href="#iclr-2026-workshop-二轮征稿聚焦终身智能体"><span>ICLR 2026 Workshop 二轮征稿聚焦终身智能体</span></a></h3><p>ICLR 2026 Workshop：当前 AI Agent 有瓶颈，迈向终身智能体是关键。Workshop 将探讨相关问题，现开启二轮征稿，鼓励跨领域研究，投稿截止 2026/2/15。<a href="https://mp.weixin.qq.com/s?__biz=MzA3MzI4MjgzMw==&amp;chksm=85cbcf75b3055a61f03eb8d5054ba539c595d21598dcef8fd7b74080cdb8845c58c06165be30&amp;idx=2&amp;mid=2651015585&amp;sn=6d26b6d17cd451b7b7dde8fab999f2f2#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="英伟达jim-fan-世界建模成新预训练范式" tabindex="-1"><a class="header-anchor" href="#英伟达jim-fan-世界建模成新预训练范式"><span>英伟达Jim Fan：世界建模成新预训练范式</span></a></h3><p>英伟达Jim Fan：世界建模将成新预训练范式，2026年大世界模型为多模态AI奠基。业内看法不一，有人看好其泛化能力，也有人指出从像素到物理跃迁难。<a href="https://mp.weixin.qq.com/s?__biz=MzIzNjc1NzUzMw==&amp;chksm=e910029041ce7ed484cdde137e28b44bca455348425ff398bcd4cad64c6df17ac30b79323138&amp;idx=2&amp;mid=2247866806&amp;sn=903f1c407663c6b8a5ceb1f0ec54816e#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="英飞凌4月1日调价-半导体洗牌加速" tabindex="-1"><a class="header-anchor" href="#英飞凌4月1日调价-半导体洗牌加速"><span>英飞凌4月1日调价，半导体洗牌加速</span></a></h3><p>英飞凌：4月1日起调价。此轮AI引领的半导体涨价潮波及多领域，英飞凌调价影响下游，成本与供应平衡成2026年半导体行业关键课题，或加速行业洗牌。<a href="https://mp.weixin.qq.com/s?__biz=MzIwMzgzNTQ1Nw==&amp;chksm=9764482dc3b3899aae0b9a4fae77d66617dce2a7fc7d4a260a42b98dd45bd703597074a2f3f2&amp;idx=1&amp;mid=2247655093&amp;sn=3933348afa30115885887227d72a79b2#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="黄仁勋-英伟达-ai-项目数量已失控" tabindex="-1"><a class="header-anchor" href="#黄仁勋-英伟达-ai-项目数量已失控"><span>黄仁勋：英伟达 AI 项目数量已失控！</span></a></h3><p>黄仁勋称编程是商品，英伟达 AI 项目数量‘失控’但应任其发展。他认为 AI 机会在‘被增强的劳动力’，企业要用 AI 革新核心工作，别成用 AI 最后一名。<a href="https://mp.weixin.qq.com/s?__biz=MjM5MDE0Mjc4MA==&amp;chksm=bc34dbd30cf5d313f2831878c5fd8f8c7496a7c9b8d501acc024da73988be34daf3f821c4609&amp;idx=1&amp;mid=2651274463&amp;sn=d2f89f7257e91a50bd863bcd35e0d636#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="谷歌tpu-推理时代的ai芯片黑马" tabindex="-1"><a class="header-anchor" href="#谷歌tpu-推理时代的ai芯片黑马"><span>谷歌TPU：推理时代的AI芯片黑马</span></a></h3><p>谷歌：TPU从10年前的“救命项目”发展成战略武器。如今TPU v7挑战英伟达，且全栈整合避“CUDA税”。推理时代，谷歌借TPU成本优势重塑行业秩序，有望构建更强壁垒。<a href="https://mp.weixin.qq.com/s?__biz=MzIwMzgzNTQ1Nw==&amp;chksm=97d852253a7a2f175b0476f0bafc9a95466ffcb4af205ea526f2cb647be0902c2762f5906db3&amp;idx=2&amp;mid=2247655093&amp;sn=f0200fb0b1045e2fad5e9da74f4b3584#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="《多模态大语言模型报告》发布" tabindex="-1"><a class="header-anchor" href="#《多模态大语言模型报告》发布"><span>《多模态大语言模型报告》发布</span></a></h3><p>中科算网算泥社区发布报告，回顾多模态大语言模型发展。2025年是‘全模态元年’，技术转向‘追求全能与实时’，混合生成范式成主流，开源生态进步但有差距，数据和评估挑战凸显。<a href="https://mp.weixin.qq.com/s?__biz=Mzg3Mzg5MjY3Nw==&amp;chksm=cf7d6d392150bf1df52ad2a4a00e622dd5dfb4aa835a272c8fc67c1a3c8ab3e2bb73d495ebdb&amp;idx=1&amp;mid=2247525749&amp;sn=66aa04dbbf0fe9d3115148fbdb724d82#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="claude-cowork插件血洗全球软件业" tabindex="-1"><a class="header-anchor" href="#claude-cowork插件血洗全球软件业"><span>Claude Cowork插件血洗全球软件业</span></a></h3><p>Anthropic为Claude Cowork新增11款插件，覆盖多领域，取代传统软件，引发全球软件股恐慌。一周内上万亿美金市值蒸发，传统SaaS模式面临挑战，有人认为软件服务经济将消亡，也有人觉得SaaS之死被夸大。<a href="https://mp.weixin.qq.com/s?__biz=MzI3MTA0MTk1MA==&amp;chksm=f0b399f8cde05f8bfad229a9cd96ecf0e449e20a2eecc6ce74bad5dca43790e4ab38ffe5f62f&amp;idx=1&amp;mid=2652671458&amp;sn=a11ece1a5b2491e1b7f1fa242136861f#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h2 id="产品应用" tabindex="-1"><a class="header-anchor" href="#产品应用"><span>产品应用</span></a></h2><h3 id="质变科技发布memorylake-引领ai记忆时代" tabindex="-1"><a class="header-anchor" href="#质变科技发布memorylake-引领ai记忆时代"><span>质变科技发布MemoryLake，引领AI记忆时代</span></a></h3><p>质变科技离哲：AI未来靠记忆驱动。其发布的MemoryLake集多种能力于一体，性能超对手。该平台已服务多行业用户企业，能降成本、提效率，抓住了企业AI落地核心需求。<a href="https://mp.weixin.qq.com/s?__biz=MzIzNjc1NzUzMw==&amp;chksm=e91bb940437bfe94b3a48a97a7f612f083527857a9a300ce38b5f87ccdc5a66a12c70b7fd540&amp;idx=1&amp;mid=2247866806&amp;sn=e04cf05339419e54b7cb4996fe4e76b5#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="北大-谷歌-paperbanana画出顶会级论文图" tabindex="-1"><a class="header-anchor" href="#北大-谷歌-paperbanana画出顶会级论文图"><span>北大+谷歌：PaperBanana画出顶会级论文图</span></a></h3><p>北大+谷歌团队推出PaperBanana：你写方法，AI画顶会级Figure。它能从零生成或润色插图，通过多智能体协作实现科研表达规范，目前AI写代码画图更靠谱，未来科研画图将更轻松。<a href="https://mp.weixin.qq.com/s?__biz=MzA3MzI4MjgzMw==&amp;chksm=85042a8b46440636fd094f07db3d5ef71d169e7b33c32678c380301cf3a6b9887e5a780a36d3&amp;idx=2&amp;mid=2651015544&amp;sn=e4fd03e97bc7356e2a442c90021dbed3#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="clawdbot更新-支持飞书集成-国产流程替代" tabindex="-1"><a class="header-anchor" href="#clawdbot更新-支持飞书集成-国产流程替代"><span>Clawdbot更新：支持飞书集成，国产流程替代</span></a></h3><p>歸藏的AI工具箱：2026.2.2 Clawdbot更新支持飞书集成。介绍集成步骤，如飞书创建机器人、Clawdbot配置等，还指出zod依赖缺失等问题及解决办法，按步骤操作基本不会卡住。<a href="https://mp.weixin.qq.com/s?__biz=MzU0MDk3NTUxMA==&amp;chksm=fa493e381b0a06794ee19cb3f13e4de46450c66f81ac230ce62548ace43781554f089a18dcfb&amp;idx=1&amp;mid=2247495632&amp;sn=1bd6e24ae0b61123702c2ab7c9391624#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="腾讯-tcinsight-助力大数据自治运维" tabindex="-1"><a class="header-anchor" href="#腾讯-tcinsight-助力大数据自治运维"><span>腾讯 TCInsight 助力大数据自治运维</span></a></h3><p>腾讯熊训德：大数据系统运维复杂，传统模式难胜任。腾讯推出 TCInsight，架构分三层，结合规则与专家系统提升自治。实践案例有成效，但仍需优化互联性、决策和专家介入，探索根因定位等方向。<a href="https://mp.weixin.qq.com/s?__biz=MjM5MDE0Mjc4MA==&amp;chksm=bcb1596067138085487197d31e7a3eabdc09145fd20d94b8da28055f1e1f4623bf63ec6ca31e&amp;idx=2&amp;mid=2651274448&amp;sn=e6dcdab374e3db24223ad4d9afd7e1b5#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="陈天桥邓亚峰推sota系统挑战大模型记忆难题" tabindex="-1"><a class="header-anchor" href="#陈天桥邓亚峰推sota系统挑战大模型记忆难题"><span>陈天桥邓亚峰推SOTA系统挑战大模型记忆难题</span></a></h3><p>陈天桥、邓亚峰团队的EverMind推出EverMemOS，模拟人脑记忆，打破多项测试记录。该系统开源且有云服务，还发起8万美元记忆起源大赛，欲重新定义大模型记忆技术路线。<a href="https://mp.weixin.qq.com/s?__biz=MzIzNjc1NzUzMw==&amp;chksm=e9c8f38b1f9a87298be34987b6cd5f690c2c0ee27b51eb20ab8712bc72524bef99357c97b591&amp;idx=1&amp;mid=2247866858&amp;sn=103a98ab766d45d0db383ac8c8405432#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h2 id="推荐文章" tabindex="-1"><a class="header-anchor" href="#推荐文章"><span>推荐文章</span></a></h2><h3 id="andrej-karpathy-vibe-coding-改变编程生态" tabindex="-1"><a class="header-anchor" href="#andrej-karpathy-vibe-coding-改变编程生态"><span>Andrej Karpathy：Vibe Coding 改变编程生态</span></a></h3><p>Andrej Karpathy 一年前提出 Vibe Coding，用户借 AI 用自然语言生成代码。如今专业人士也常用此工作流，未来模型和 Agent 层会进步，Vibe Coding 会独特存在。<a href="https://mp.weixin.qq.com/s?__biz=MjM5ODQ2MDIyMA==&amp;chksm=bf5d13941940b2dc2a5a870964a18cf39b5571550856e36e0e1686c7472cb6692a8264527d03&amp;idx=1&amp;mid=2650733759&amp;sn=535d1c09c6a8446d6a4cfac9213f8f6e#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="daniel-ai助力粒子物理探索新粒子" tabindex="-1"><a class="header-anchor" href="#daniel-ai助力粒子物理探索新粒子"><span>Daniel：AI助力粒子物理探索新粒子</span></a></h3><p>物理学家Daniel Whiteson称，粒子物理核心是用还原论解释宇宙，当前对基础粒子认知有诸多空白。粒子对撞实验复杂，需机器学习辅助。深度学习已广泛应用，基于图神经网络的粒子追踪技术有望发现新粒子。<a href="https://mp.weixin.qq.com/s?__biz=MzU4ODk1NDUwOA==&amp;chksm=fc9d0aebb93d1b7e647ee759ded620a0b0eda71eb995a731ca1c144ba7d76c0795249c4d14c8&amp;idx=1&amp;mid=2247516809&amp;sn=0b5356199668fe5139b98122a565a61c#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="cursor翻车-moonbit打造ai软件工厂" tabindex="-1"><a class="header-anchor" href="#cursor翻车-moonbit打造ai软件工厂"><span>Cursor翻车，MoonBit打造AI软件工厂</span></a></h3><p>Cursor用AI构建浏览器失败，MoonBit团队不同路线成功。他们10天生成C编译器，其语言设计、工具链等有优势，还支持多后端，有望让软件工程走向自动化，InfoQ还联合发起挑战赛。<a href="https://mp.weixin.qq.com/s?__biz=MjM5MDE0Mjc4MA==&amp;chksm=bcfd6c504b121ff5e28ef784e9222ab47b39c1c152fd0e9e8f5bea67c23f94d553be476615ca&amp;idx=1&amp;mid=2651274448&amp;sn=fe6a045b065dc4e34d6d541627e81091#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h2 id="开源动态" tabindex="-1"><a class="header-anchor" href="#开源动态"><span>开源动态</span></a></h2><h3 id="蚂蚁灵波-开辟具身智能新路径" tabindex="-1"><a class="header-anchor" href="#蚂蚁灵波-开辟具身智能新路径"><span>蚂蚁灵波：开辟具身智能新路径</span></a></h3><p>Yann LeCun：大语言模型难触现实，真智能要会推演未来。蚂蚁灵波朱兴、沈宇军：从物理交互探索具身智能，选真实数据路线，开源四款模型，要构建机器人‘安卓系统’。<a href="https://mp.weixin.qq.com/s?__biz=MzA3MzI4MjgzMw==&amp;chksm=85c96388a3806eefe94416256395b9022af73361e2e54b795a6f4b11cf99df2c3c715f814858&amp;idx=1&amp;mid=2651015544&amp;sn=6cf63094131bf3752559cc41921eb14c#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="skip-跨平台框架宣布完全开源" tabindex="-1"><a class="header-anchor" href="#skip-跨平台框架宣布完全开源"><span>Skip 跨平台框架宣布完全开源</span></a></h3><p>Skip 团队将跨平台框架 Skip 完全开源。此前它是付费方案，开源一是因开发者想免费获工具，二是保证持久性，能实现原生体验，不过较适合少外部依赖的新项目。<a href="https://mp.weixin.qq.com/s?__biz=MjM5MDE0Mjc4MA==&amp;chksm=bc0a8bc2d7d47f2de56d96f943d99f96e630f8a6ef68b28a764abf3067a25d14e621cda1a745&amp;idx=4&amp;mid=2651274448&amp;sn=65b2a9bf87e011d514108eac4fe5f293#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="谷歌北大联手-paperbanana精确生成论文图表" tabindex="-1"><a class="header-anchor" href="#谷歌北大联手-paperbanana精确生成论文图表"><span>谷歌北大联手，PaperBanana精确生成论文图表</span></a></h3><p>谷歌北大联手推出PaperBanana，由5个智能体协作。经实验，它在各维度超传统基线方法，生成图表既精确又美观，不过目前有无法编辑等局限，可用于优化旧图。<a href="https://mp.weixin.qq.com/s?__biz=MzIzNjc1NzUzMw==&amp;chksm=e973bf610b6c596bd2f21492594e7d679c128e45167439ee6b7c9e90fba35d661eb3f9ee2d53&amp;idx=2&amp;mid=2247866858&amp;sn=aecef67dddb95c8a1f9fe2c2a43d302d#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="面壁智能-让-ai-从云端走向端侧" tabindex="-1"><a class="header-anchor" href="#面壁智能-让-ai-从云端走向端侧"><span>面壁智能：让 AI 从云端走向端侧</span></a></h3><p>面壁智能在 Agent 概念狂热时，发布 9B 小模型 MiniCPM - o 4.5 和硬件开发板松果派。解决现有 AI 延迟、隐私问题，让 AI 从云端走向端侧，构建端侧生态，有望成为具身智能关键。<a href="https://mp.weixin.qq.com/s?__biz=Mzg4NDQwNTI0OQ==&amp;chksm=ce10d1c141b72c626ef3e126896c1dfe09d1ed9ff65c1caf9761aeeb789b0d550073f6b47b81&amp;idx=1&amp;mid=2247588743&amp;sn=cfdc72a28df9289b79a5f0aa53923b9b#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="上海ai实验室开源万亿科学大模型intern-s1-pro" tabindex="-1"><a class="header-anchor" href="#上海ai实验室开源万亿科学大模型intern-s1-pro"><span>上海AI实验室开源万亿科学大模型Intern - S1 - Pro</span></a></h3><p>2月4日上海AI实验室开源Intern - S1 - Pro，作为全球最大科学多模态模型，能力领先。它创新架构，协同通用与科学能力，构建‘算力 - 算法’基座，还高质量开源，降低科研门槛，推动范式革命。<a href="https://mp.weixin.qq.com/s?__biz=Mzk0MDQyNTY4Mw==&amp;chksm=c33687c9c8b15a2771f01133841534c201286d3707b55208f0acdc4227d8271bfe0f2282b13e&amp;idx=1&amp;mid=2247496375&amp;sn=89e0b8d1518178225d64044f93f85d8b#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h2 id="算法论文" tabindex="-1"><a class="header-anchor" href="#算法论文"><span>算法论文</span></a></h2><h3 id="cmu提出最大似然强化学习-性能更优" tabindex="-1"><a class="header-anchor" href="#cmu提出最大似然强化学习-性能更优"><span>CMU提出最大似然强化学习，性能更优</span></a></h3><p>CMU等研究机构表示，现实中强化学习未真正做最大似然优化，只是优化其一阶近似。为此提出最大似然强化学习，实验表明其在性能和计算效率上优于现有方法。<a href="https://mp.weixin.qq.com/s?__biz=MzA3MzI4MjgzMw==&amp;chksm=8592c96796074f18deb49671c1ead7c959b476837492d9d44c731f037f8f6905df386955abce&amp;idx=1&amp;mid=2651015585&amp;sn=7d79661ee5ac421502fd3a081ac69656#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="复旦与阿里-模型自适应切换思考模式提升推理能力" tabindex="-1"><a class="header-anchor" href="#复旦与阿里-模型自适应切换思考模式提升推理能力"><span>复旦与阿里：模型自适应切换思考模式提升推理能力</span></a></h3><p>复旦大学和阿里实验室：现有视觉推理方法分纯文本和用图思考模式，各有利弊。提出 Mixture-of-Visual-Thoughts 范式及相关算法，让模型自适应选模式，实验显示其在多任务上表现出色，有通用提升。<a href="https://mp.weixin.qq.com/s?__biz=MzA3MzI4MjgzMw==&amp;chksm=853a301650b592afb76d871373e8c3696aa8842f7c21754d33a0e694bac88201cc1ba7d6c475&amp;idx=3&amp;mid=2651015544&amp;sn=9dc01133077f122da429f00f3dc8ccb0#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><p style="text-align:center;"><img id="weixin_qr" src="https://meikan-public-images.oss-cn-beijing.aliyuncs.com/imeikan/assets/2025-05-18234303-hub.png" style="max-width:800px;object-fit:cover;"></p><p><a href="https://aireadinghub.com/" target="_blank" rel="noopener noreferrer">官网：www.AiReadingHub.com</a></p>',53)]))}const s=e(d,[["render",c]]),l=JSON.parse('{"path":"/posts/2026-02-06.html","title":"AI日报：ICLR 2026 Workshop 二轮征稿聚焦终身智能体; 英伟达Jim Fan：世界建模成新预训练范式; 英飞凌4月1日调价，半导体洗牌加速","lang":"zh-CN","frontmatter":{"date":"2026-02-06T00:00:00.000Z","title":"AI日报：ICLR 2026 Workshop 二轮征稿聚焦终身智能体; 英伟达Jim Fan：世界建模成新预训练范式; 英飞凌4月1日调价，半导体洗牌加速"},"headers":[{"level":2,"title":"新闻资讯","slug":"新闻资讯","link":"#新闻资讯","children":[{"level":3,"title":"ICLR 2026 Workshop 二轮征稿聚焦终身智能体","slug":"iclr-2026-workshop-二轮征稿聚焦终身智能体","link":"#iclr-2026-workshop-二轮征稿聚焦终身智能体","children":[]},{"level":3,"title":"英伟达Jim Fan：世界建模成新预训练范式","slug":"英伟达jim-fan-世界建模成新预训练范式","link":"#英伟达jim-fan-世界建模成新预训练范式","children":[]},{"level":3,"title":"英飞凌4月1日调价，半导体洗牌加速","slug":"英飞凌4月1日调价-半导体洗牌加速","link":"#英飞凌4月1日调价-半导体洗牌加速","children":[]},{"level":3,"title":"黄仁勋：英伟达 AI 项目数量已失控！","slug":"黄仁勋-英伟达-ai-项目数量已失控","link":"#黄仁勋-英伟达-ai-项目数量已失控","children":[]},{"level":3,"title":"谷歌TPU：推理时代的AI芯片黑马","slug":"谷歌tpu-推理时代的ai芯片黑马","link":"#谷歌tpu-推理时代的ai芯片黑马","children":[]},{"level":3,"title":"《多模态大语言模型报告》发布","slug":"《多模态大语言模型报告》发布","link":"#《多模态大语言模型报告》发布","children":[]},{"level":3,"title":"Claude Cowork插件血洗全球软件业","slug":"claude-cowork插件血洗全球软件业","link":"#claude-cowork插件血洗全球软件业","children":[]}]},{"level":2,"title":"产品应用","slug":"产品应用","link":"#产品应用","children":[{"level":3,"title":"质变科技发布MemoryLake，引领AI记忆时代","slug":"质变科技发布memorylake-引领ai记忆时代","link":"#质变科技发布memorylake-引领ai记忆时代","children":[]},{"level":3,"title":"北大+谷歌：PaperBanana画出顶会级论文图","slug":"北大-谷歌-paperbanana画出顶会级论文图","link":"#北大-谷歌-paperbanana画出顶会级论文图","children":[]},{"level":3,"title":"Clawdbot更新：支持飞书集成，国产流程替代","slug":"clawdbot更新-支持飞书集成-国产流程替代","link":"#clawdbot更新-支持飞书集成-国产流程替代","children":[]},{"level":3,"title":"腾讯 TCInsight 助力大数据自治运维","slug":"腾讯-tcinsight-助力大数据自治运维","link":"#腾讯-tcinsight-助力大数据自治运维","children":[]},{"level":3,"title":"陈天桥邓亚峰推SOTA系统挑战大模型记忆难题","slug":"陈天桥邓亚峰推sota系统挑战大模型记忆难题","link":"#陈天桥邓亚峰推sota系统挑战大模型记忆难题","children":[]}]},{"level":2,"title":"推荐文章","slug":"推荐文章","link":"#推荐文章","children":[{"level":3,"title":"Andrej Karpathy：Vibe Coding 改变编程生态","slug":"andrej-karpathy-vibe-coding-改变编程生态","link":"#andrej-karpathy-vibe-coding-改变编程生态","children":[]},{"level":3,"title":"Daniel：AI助力粒子物理探索新粒子","slug":"daniel-ai助力粒子物理探索新粒子","link":"#daniel-ai助力粒子物理探索新粒子","children":[]},{"level":3,"title":"Cursor翻车，MoonBit打造AI软件工厂","slug":"cursor翻车-moonbit打造ai软件工厂","link":"#cursor翻车-moonbit打造ai软件工厂","children":[]}]},{"level":2,"title":"开源动态","slug":"开源动态","link":"#开源动态","children":[{"level":3,"title":"蚂蚁灵波：开辟具身智能新路径","slug":"蚂蚁灵波-开辟具身智能新路径","link":"#蚂蚁灵波-开辟具身智能新路径","children":[]},{"level":3,"title":"Skip 跨平台框架宣布完全开源","slug":"skip-跨平台框架宣布完全开源","link":"#skip-跨平台框架宣布完全开源","children":[]},{"level":3,"title":"谷歌北大联手，PaperBanana精确生成论文图表","slug":"谷歌北大联手-paperbanana精确生成论文图表","link":"#谷歌北大联手-paperbanana精确生成论文图表","children":[]},{"level":3,"title":"面壁智能：让 AI 从云端走向端侧","slug":"面壁智能-让-ai-从云端走向端侧","link":"#面壁智能-让-ai-从云端走向端侧","children":[]},{"level":3,"title":"上海AI实验室开源万亿科学大模型Intern - S1 - Pro","slug":"上海ai实验室开源万亿科学大模型intern-s1-pro","link":"#上海ai实验室开源万亿科学大模型intern-s1-pro","children":[]}]},{"level":2,"title":"算法论文","slug":"算法论文","link":"#算法论文","children":[{"level":3,"title":"CMU提出最大似然强化学习，性能更优","slug":"cmu提出最大似然强化学习-性能更优","link":"#cmu提出最大似然强化学习-性能更优","children":[]},{"level":3,"title":"复旦与阿里：模型自适应切换思考模式提升推理能力","slug":"复旦与阿里-模型自适应切换思考模式提升推理能力","link":"#复旦与阿里-模型自适应切换思考模式提升推理能力","children":[]}]}],"git":{"updatedTime":1770612201000,"contributors":[{"name":"GitHub Actions","username":"","email":"actions@github.com","commits":1}],"changelog":[{"hash":"34295977c5f2d15dde3ff050cdb305253871fc16","time":1770612201000,"email":"actions@github.com","author":"GitHub Actions","message":"Auto-commit generated files on 2026-02-09T04:43:21.970Z"}]},"filePathRelative":"posts/2026-02-06.md","excerpt":"<blockquote>\\n<p>All in AI，看见未来。 每天精选最值得读的AI文章，帮你筛掉时代的噪音。 以简讯见广度，以深读见洞察。 技术、趋势、思考，一站式掌握AI世界。\\n欢迎关注公众号「AI Reading Hub」，获取更多AI资讯和技术文章。</p>\\n</blockquote>\\n<h1>2026-02-06 资讯日报</h1>\\n<h2>新闻资讯</h2>\\n<h3>ICLR 2026 Workshop 二轮征稿聚焦终身智能体</h3>\\n<p>ICLR 2026 Workshop：当前 AI Agent 有瓶颈，迈向终身智能体是关键。Workshop 将探讨相关问题，现开启二轮征稿，鼓励跨领域研究，投稿截止 2026/2/15。<a href=\\"https://mp.weixin.qq.com/s?__biz=MzA3MzI4MjgzMw==&amp;chksm=85cbcf75b3055a61f03eb8d5054ba539c595d21598dcef8fd7b74080cdb8845c58c06165be30&amp;idx=2&amp;mid=2651015585&amp;sn=6d26b6d17cd451b7b7dde8fab999f2f2#rd\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">&gt;阅读原文</a></p>"}');export{s as comp,l as data};
